import React, { useState, useEffect } from "react";
import axios from "axios";
import Table from "./TableContainer"
import { SelectColumnFilter } from "./Filter" 

import "./App.css"

function App() {
  const [data, setData] = useState([]);

      // data = res.components[0].content.ref

  useEffect(() => {
    // axios("http://cms.swiftnav.com/decoupler/translate-path?path=/resource-library")
    // .then((res) => {
    //   setData(res.components[0].content.ref);
    //   console.log(res)
    // })
    // .catch((err) => console.log(err))
    fetch("http://cms.swiftnav.com/decoupler/translate-path?path=/resource-library", {
    // headers: {"Access-Control-Allow-Origin": "*"},
    // method: 'GET',
    credentials: 'include',
})
        .then(response => response.json())
        .then(json => console.log(json))
  }, []);

  const columns = [
    {
      Header: "Title",
      accessor: "title", 
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Version", 
      accessor: "release_version",
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Release Date",
      accessor: "release_date",
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Product",
      accessor: "related_product",
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Catagory", 
      accessor: "asset_type", 
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "File",
      accessor: "filename", 
      Cell: (row) => 
      <a href={row.row.original.uri}>{row.row.original.filename}</a>,
    },
    {
      Header: "VersionType",
      accessor: "version_type", 
      Filter: SelectColumnFilter,
      filter: "includes",
    },
    {
      Header: "Size",
      accessor: "filesize",
    },
  ];

  return (
    <div className="App">
     <h1>
      <center>Resource Library</center>
     </h1>
     <Table columns={columns} data={data} />
    </div>
  );
}

export default App;
